Le Tibet, ou anciennement Thibet, (tibétain བོད་, Wylie : Bod, chinois : 西藏 ; pinyin : Xīzàng) est une région de plateau située au nord de l'Himalaya en Asie, habitée traditionnellement par les Tibétains et d'autres groupes ethniques (Monbas, Qiang et Lhobas) et comportant également une population importante de Hans et de Huis. Le Tibet est le plateau habité le plus élevé de la planète, avec une altitude moyenne de 4 900 m. Sous l'appellation « Tibet historique », cette aire, revendiquée par le gouvernement tibétain en exil, est composée de trois régions traditionnelles : 
* l'Ü-Tsang : dont la plus grande partie du territoire est comprise dans la région autonome du Tibet ; 
* l'Amdo : éclaté entre les provinces du Qinghai, du Gansu et du Sichuan ; 
* le Kham : dont le territoire est partagé entre les provinces du Sichuan et du Yunnan et la région autonome du Tibet). La superficie du Tibet varie de 1 221 600 km2 pour la Région autonome du Tibet à 2 500 000 km2 pour le « Tibet historique » ou « Grand Tibet ». La capitale historique qui, traditionnellement, concentre l'autorité religieuse et temporelle du Tibet, est Lhassa. Les Tibétains, dont le nombre est de 6 millions en République populaire de Chine, parlent un des trois dialectes du tibétain, une langue de la famille tibéto-birmane, et pratiquent majoritairement le bouddhisme tibétain.
